import React, { Component } from 'react'

class DashboardComp extends Component {
    state={
        event :[
        {'id':1001,'eventName':'Birthday party','Date':'12/03.2021'},
        {'id':1002,'eventName':'EBM party','Date':'03/07.2021'},
    ]}
    render() {
        return (

            <div className="card mx-3 my-3">
            <div className="card-body">
                <h5 className="card-title">Card title</h5>
                <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                <a href="#" className="btn btn-primary">Go somewhere</a>
            </div>
            {this.state.event.map(e =>{<h5 className="card-title">{e.eventName}</h5>})}
            {/* {this.state.event.map(e =>
                        <tr>
                            <td>{e.id}</td><td>{e.eventName}</td><td>{e.Date}</td>
                        </tr>)} */}
            </div>
        )
    }
}
export default DashboardComp;
